// router/index.js
import { createRouter, createWebHistory } from 'vue-router'
import ReasourceHome from '../views/ResourceHome.vue'

import StudentLibrary from '../views/Student/StudentLibrary.vue'
import TeaStuClassroom from '../views/Student/TeaStuClassroom.vue'  // 这个导入现在会被使用
import StuProfile from '@/views/Profile/stuProfile.vue'

const routes = [
  {
    path: '/home',
    name: 'Home',
    redirect: '/resouce-home'  
  },
  {
    path: '/resouce-home',
    name: 'Home',
    component: ReasourceHome,
    meta: { showSidebar: false } // 首页不需要侧边栏
  },
  {
    path: '/admin-classroom',
    name: 'AdminClassroom',
    component: AdminClassroom
  },
  {
    path: '/admin-approve',
    name: 'AdminApprove',
    component: AdminApprove
  },
  {
    path: '/admin-library',
    name: 'AdminLibrary',
    component: AdminLibrary
  },
  {
    path: '/student-library',
    name: 'StudentLibrary',
    component: StudentLibrary,
    meta: { showSidebar: true } 
  },
  {
    path: '/tea-stu-classroom',  
    name: 'TeaStuClassroom',
    component: TeaStuClassroom,
    meta: { showSidebar: true } 
  },
  {
    path: '/stu-profile',
    name: 'stuProfile',
    component: StuProfile,
    meta: { showSidebar: false } // 个人资料页面不需要侧边栏
  }
]

const router = createRouter({
  history: createWebHistory(),
  routes
})

export default router
